import "./index.css";

function App() {
  return (
    <div className="App">
      <BillPrice />
    </div>
  );
}

function BillPrice() {
  return (
    <div>
      <label>How much was the bill?</label>
      <input type="text"></input>
    </div>
  );
}

function ServiceGrade() {
  return (
    <div>
      <label>Text</label>
      <input type="text"></input>
    </div>
  );
}

export default App;
